import React from 'react';

import { withStyles } from '@material-ui/styles'; // jss library
import {Typography} from '@material-ui/core';
import {Link} from 'react-router-dom';
import ExternalLink from '../../../ExternalLink';

import img1 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/1.jpg';
import img2 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/2.jpg';
import img3 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/3.jpg';
import img4 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/4.jpg';
import img5 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/5.jpg';
import img6 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/6.jpg';
import img7 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/7.jpg';
import img8 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/8.jpg';
import img9 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/9.jpg';
import img10 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/10.jpg';
import img11 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/11.jpg';
import img12 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/12.jpg';
import img13 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/13.jpg';
import img14 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/14.jpg';
import img15 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/15.jpg';
import img16 from '../../../../assets/img/blogs/messapps/improving-your-app-todays-top-earning-app-characteristics/16.jpg';

const jssStyle = theme => ({
    img: {
      display: 'block',
      marginLeft: 'auto',
      marginRight: 'auto',
      marginBottom: '30px',
      marginTop: '30px',
      maxWidth: '90%'
    },
    blockQuote: {
      background: '#f9f9f9',
      borderLeft: '10px solid #ccc',
      margin: '1.5em 10px !important',
      padding: '0.5em 10px',
      display: 'block',
      quotes: `'"''"''"''"'`,
      '&::before': {
        color: '#ccc',
        content: 'open-quote',
        fontSize: '4em',
        lineHeight: '0.1em',
        marginRight: '0.25em',
        verticalAlign: '-0.4em'
      }
    },
    center: {
        textAlign: 'center'
    }
})

const ImprovingYourAppTodaysTopEarningAppCharacteristics = (props) => {
  const {classes} = props;
  return (
    <div>
        <Typography className={classes.center} paragraph>
        <Link to={'/blogs/messapps/the-app-store-a-comprehensive-analysis'}>With only one exception, every top­grossing Google Play app is a gaming app. Unsurprisingly, each one of those gaming apps are also occupying the top­grossing list on Apple's App Store.</Link>
        </Typography>
        <img src={img1} className={classes.img} alt='Top grossing iPhone apps'/>
        <img src={img2} className={classes.img} alt='Top Grossing Android apps'/>
        <img src={img3} className={classes.img} alt=''/>
        <img src={img4} className={classes.img} alt=''/>
        <img src={img5} className={classes.img} alt=''/>
        <img src={img6} className={classes.img} alt=''/>
        <img src={img7} className={classes.img} alt=''/>
        <img src={img8} className={classes.img} alt=''/>
        <img src={img9} className={classes.img} alt=''/>
        <img src={img10} className={classes.img} alt=''/>
        <img src={img11} className={classes.img} alt=''/>
        <img src={img12} className={classes.img} alt=''/>
        <img src={img13} className={classes.img} alt=''/>
        <img src={img14} className={classes.img} alt=''/>
        <img src={img15} className={classes.img} alt=''/>
        <img src={img16} className={classes.img} alt=''/>
        
    </div>
  )
}

export default withStyles(jssStyle, {withTheme: true})(ImprovingYourAppTodaysTopEarningAppCharacteristics)
